def ways(n):
    # number of ways to reach top
    # if n is 0, then 1 way to reach
    # if n is 1, then 2 ways to reach (1 step or 2 steps)
    # if n is 2, then 3 ways to reach (1 step or 2 steps or 3 steps)
    # and so on...
    if n == 0:
        return 1
    elif n == 1:
        return 2
    else:
        return ways(n-1) + ways(n-2)

